import React from 'react';
//Style
import {Container,Row,Col} from 'react-bootstrap'


const Footer = () => {
  return (
    <footer>
      <Container>
        <Row>
            <Col className='text-center py-3'>
            &copy; Juraj Basanda
            </Col>
        </Row>
      </Container>
    </footer>
  );
}

export default Footer;
